import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'my_app';
}
<!DOCTYPE html>
<html>


<form>
  <input type="text" placeholder="Search...">
  <button type="submit">Search</button>
</form>
